import json


class VDOM_tabulator(VDOM_object):

    def render(self, contents=""):

        idn = (self.id).replace('-', '_')
        id = u'o_' + idn
        id_tabulator = u't_' + idn

        display = u" display:none; " if self.visible == "0" else u""

        style = u"""{display}z-index: {zind}; position: absolute; top: {top}px; left: {left}px; height: {height}px; width: {width}px""" \
            .format(display=display, zind=self.zindex, top=self.top, left=self.left, height=self.height,
                    width=self.width)

        cssclass = u"""class="%s" """ % self.cssclass if self.cssclass else u""

        params = []

        # custom_style = []

        hidden_columns = [item.encode('UTF8') for item in self.hiddenfields.split()]

        hidden_fields_styles = ""


        if self.fit_to_container == "1":
            params.append(u"fitToContainer:true,")

        if self.rows_height:
            params.append(u"rowHeight: %s," % (self.rows_height))

        if self.selection == "1":
            params.append(u"selectable:true,")
            params.append("selectable:1,")

        if self.columns_auto_width == "1":
            params.append(u'layout: "fitDataStretch",')

        if self.pagelength != '-1' or self.pagging == 'remote':
        	params.append(u'pagination: "{}",'.format(self.pagging))
        	params.append(u'paginationSize: {},'.format(self.pagelength))

        if self.custom:
            params.append(self.custom)

        if VDOM_CONFIG_1["DEBUG"] == "1":
            debug_info = u"objtype='%s' objname='%s' ver='%s'" % (self.type.name, self.name, self.type.version)
        else:
            debug_info = u""

        result = u"""
		<div %(debug_info)s id='%(id)s' style='%(style)s' %(cssclass)s>
			<div id="%(id_tabulator)s" style="width:100%%; height:100%%"></div>
		</div>
		<style type="text/css">
			%(selfstyle)s
		</style>

		<script type="text/javascript">
$(document).ready(() => {
    function singleClick(e, row) {
      execEventBinded('%(idn)s', 'cellclick', {
              keyField: row.getData().%(keyField)s,
              cellData:JSON.stringify(row.getData()),
              columnData:JSON.stringify(e)
          }
      );
    }


    function selectionChange(data, rows) {
    const keys = data.map(({ %(keyField)s }) => %(keyField)s);

    execEventBinded('%(idn)s', 'rowsselected', {
            keyList: keys
        }
    );
    }

    function doubleClick(e, row) {
    const key = row.getData().%(keyField)s;

    execEventBinded('%(idn)s', 'celldblclick', {
            keyField: key,
            cellData:JSON.stringify(row.getData()),
            columnData:JSON.stringify(e)
        }
    );
    }

    window.%(id_tabulator)s = new Tabulator("#%(id_tabulator)s", {
      height:"100%%",
      data: %(data)s,
      dataTree:true,
      dataTreeStartExpanded: %(data_tree_start_expanded)s,
      columns: %(columns)s,
      responsiveLayout: "hide",
      placeholder:"No Data Available",
      rowClick: function (e, row) {singleClick(e, row);},
      rowDblClick: function (e, row) {doubleClick(e, row);},
      rowSelectionChanged: function (e, row) {selectionChange(e, row);},
      %(params)s
    });

    var cols_to_hide = %(hidden_columns)s;

    cols_to_hide.forEach(function(item,i,cols_to_hide) { %(id_tabulator)s.hideColumn(item) }); 
});
		</script>
""" % {
            "debug_info": debug_info,
            "id": id,
            "idn": idn,
            "id_tabulator": id_tabulator,
            "style": style,
            "selfstyle": self.style % {"id": id},
            "cssclass": cssclass,
            "params": '\n'.join(params),
            "data": self.data,
            "columns": self.columns,
            "keyField": self.key,
            "hidden_fields_styles": hidden_fields_styles,
            "hidden_columns": hidden_columns,
            "data_tree_start_expanded": 'true' if self.datatreestartexpanded == "1" else 'false'
        }

        return VDOM_object.render(self, contents=result)

    def wysiwyg(self, contents=""):
        from scripting.legacy.wysiwyg import get_empty_wysiwyg_value

        image_id = "40264b4b-9d99-4453-941c-fe836f1c86ec"
        result = get_empty_wysiwyg_value(self, image_id)

        return VDOM_object.wysiwyg(self, contents=result)

